import React from 'react'

import Header from './StartPage/Header';
import StartPage from './StartPage/StartPage'

import {
    BrowserRouter as Router,
    Route,
    Routes
  } from "react-router-dom";



function App() {

  return (
    <>
        <Router>
                <Header></Header>
                <Routes>
                <Route exact path="/" element={<StartPage></StartPage>}></Route>

                </Routes>
        </Router>
    </>
  )
}

export default App;
